from functools import reduce
from number import numbers

mtx_20x20 = []

for i in range(20):
    mtx_list = numbers[i * 20 : (i + 1) * 20]
    mtx_20x20.append(mtx_list)


def create_diagonals(mtx):
    """
    Takes a matrix of equal length and height and returns
    a matrix consisting of 4x4 sub matrices of the given matrix
    """

    grids = []

    # i will iterate mtx len(19) - 3 ===> 16 times
    # j will iterate len of each list inside the mtx (19) - 3 ===> 16 times
    # initialize an empty sub_mtx list
    # append each 4x4 grid
    # examine the live code result

    for i in range(len(mtx) - 3):
        for j in range(len(mtx[0]) - 3):
            sub_mtx = []
            sub_mtx.append(mtx[i][j : j + 4])
            sub_mtx.append(mtx[i + 1][j : j + 4])
            sub_mtx.append(mtx[i + 3][j : j + 4])
            sub_mtx.append(mtx[i + 3][j : j + 4])
            grids.append(sub_mtx)

    return grids


