def get_max_vertically(mtx):

    max = 0

    for i in range(len(mtx)):
        multiplication = 1
        for j in range(len(mtx)):
            multiplication *= mtx[j][i]
            if multiplication > max:
                max = multiplication

    return max


vertical_max_values = [get_max_vertically(mtx_4x4[i]) for i in range(len(mtx_4x4))]
vertical_max = max(vertical_max_values)  # 62567716


def get_max_diagonally(mtx):

    max = 0

    multiplication = 1
    right_multiplication = 1

    for i in range(len(mtx)):
        multiplication *= mtx[i][i]
        right_multiplication *= mtx[len(mtx) - 1 - i][i]
    bigger_multiplication = (
        multiplication
        if multiplication > right_multiplication
        else right_multiplication
    )
    if bigger_multiplication > max:
        max = bigger_multiplication

    return max


